import './Element.css';

function Element({season, revenue, price, mean}) {

    return (
        <div className="box">
            <div className="line">Season : {season}</div>
            <div className="line">----------</div>
            <div className="line">Revenue : {revenue}</div>
            <div className="line">TicketPrice : {price}</div>
        </div>
    );
}
export default Element;
